import React from "react";
import ReactDOM from "react-dom/client";
import "./ChatApp.css";
import App from "./App"; // Use `ChatApp` if you didn't rename it to `App.js`

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
